        {
          id: "e2",
          title: "Car Insurance",
          amount: 234,
          date: new Date(2020, 3, 12),
        },
        { id: "e3", title: " New TV", amount: 2000, date: new Date(2020, 2, 2) },
        { id: "e1", title: "New Desk", amount: 234, date: new Date(2020, 4, 3) },

      ];

 const expenseDataHandler = (expenseData) => {
  const newExpense = {
    ...expenseData,
  };
  console.log("Hello from Apps.js\n",newExpense);
}


  return (
    <div>
      <NewExpense onNewExpenseData ={expenseDataHandler}/>
    <Expenses expense = {expenses}  />
    </div>
  );
}

export default App;
